import pandas as pdimport pytestfrom oilanalytics.freight.tce import tce_calcdef test_tc2():    dd = {        'FlatRate': 14.73,        'PortCosts': 91276.748,        'WorldScale': 80.56,        'RottA': 0.35,        'RottB': 0.57,        'VLSFO': 276.75,        'HSFO': 227.5,        'LSFO': 243.5,        'MGO': 339.5,    }    data = pd.DataFrame(dd, index=[pd.to_datetime('2020-06-25')])    res = tce_calc.calc('tc2', data)    assert res['GrossFreight']['2020-06-25'] == pytest.approx(469632.97, 0.1)    assert res['BunkerCost']['2020-06-25'] == pytest.approx(200407.9, 0.1)    assert res['TCE']['2020-06-25'] == pytest.approx(5728.616354, 0.1)def test_tc5():    dd = {         'FlatRate': 24.54,         'WorldScale': 80.0,         'MGO': 355.001,         'VLSFO': 291.64,         'HSFO': 225.79,         'WS': 80.0,         'PortCosts': 74534.074,         }    data = pd.DataFrame(dd, index=[pd.to_datetime('2020-06-25')])    res = tce_calc.calc('tc5', data)    assert res['GrossFreight']['2020-06-25'] == pytest.approx(1094610.0, 0.1)    assert res['BunkerCost']['2020-06-25'] == pytest.approx( 427723.30, 0.1)    assert res['TCE']['2020-06-25'] == pytest.approx(10902.00, 0.1)